class ChartHead extends Component {
	constructor(props) {
		super(props);
		this.state = {

		};
	}

	render() {
		return (
			<Fragment>
				<span className="chart-header">{this.props.title}</span>
				<span className="chart-desc">{this.props.desc}</span>
				<div className="schedule-heading">
					<div className="left-column column-head">Date</div>
					<div className="column-head">Time</div>
					<div className="flex-column column-head">Type</div>
					<div className="right-column column-head">Address</div>
				</div>
			</Fragment>
		)
	}
}

